import React from "react";
import { Form, Button } from "react-bootstrap";

const Login = () => {
  return (
    <div>
      <Form>
        <input type="text" name="" id="" placeholder="name" />
        <input type="password" name="" id="" placeholder="password" />
        <Button>LOGIN</Button>
      </Form>
    </div>
  );
};

export default Login;
